      <div className={classes.modal}>
        <div className={classes.header}>
          <h2></h2>
        </div>
        <div className={classes.content}>
          <div className={classes.actions}></div>
          <Button>Okay</Button>
        </div>
      </div>
    </div>
  );
};

export default ErrorModal;
